queries.query:
select TO_DATE(CAST(UNIX_TIMESTAMP(order_purchase_timestamp, 'yyyy-MM-dd HH:mm:ss') AS TIMESTAMP)) as day, sum(payment_value) as amount from field_demos_retail.payments p
inner join field_demos_retail.orders o on o.order_id = p.order_id 
group by day having day < '2018-08-01' and day > '2017-01-01' order by day ;

